import style from "./SearchBar.module.css";

const SearchBar = (props) => {
   return (
      <div className= {style.navBar}>
         <input type='search' />
         <button id={style.buttonSearch} onClick={() =>{props.onSearch()}}>Agregar</button> {/**la arrow fc evita que, si paso un param. la funcion se ejecute inmediatamente sin hacer click */}
         <h1>Proyect: Rick and Morty</h1>
         <ul className={style.navList}>
            <li>enlace 1</li>
            <li>enlace 2</li>
            <li>enlace 3</li>
            <li>enlace 4</li>
         </ul>
      </div>
   );
}

export default SearchBar;
